    <title>谛听版权保护系统</title>
    <link rel="stylesheet" type="text/css" href="../static/css/style.css">
</head>
<body>
    <div class="login-page">
        <div class="login-image">
            <img src="../static/img/login-image.png" alt="登录图片">
        </div>
        <div class="login-container">
            <h1>欢迎使用谛听版权保护系统</h1>
            <form id="login-form" onsubmit="return validateCaptcha()">
                <label for="username">用户名</label>
                <input type="text" id="username" name="username" placeholder="12345678910">

                <label for="password">密码</label>
                <input type="password" id="password" name="password" placeholder="请输入密码">

                <label for="captcha">验证码</label>
                <div class="captcha-container">
                    <input type="text" id="captcha" name="captcha" placeholder="请输入验证码">
                    <img id="captcha-image" src="" alt="验证码">
                </div>

                <button type="submit">登录</button>
                <div class="options">
                    <input type="checkbox" id="remember" name="remember">
                    <label for="remember">记住密码</label>
                    <a href="#">忘记密码</a>
                </div>
            </form>
        </div>
    </div>
    <script>
            document.addEventListener('keydown', function(event) {
    if (event.keyCode === 123) { // F12键的键码
        event.preventDefault();
    }
});
    document.addEventListener('contextmenu', function(event) {
    event.preventDefault();
});
    window.addEventListener('load', function() {
    const check = () => {
        if (document.hidden) {
            console.log('DevTools opened!');
            // 可以在这里执行一些操作
        }
    };
    document.addEventListener('visibilitychange', check);

        function getRandomCaptcha() {
            const randomIndex = Math.floor(Math.random() * captchaImages.length);
            return captchaImages[randomIndex];
        }

        function validateCaptcha() {
            const userInput = document.getElementById('captcha').value;
            const captchaImageSrc = document.getElementById('captcha-image').src;
            const correctCaptcha = captchaImageSrc.split('/').pop().substring(0, 4);

            if (userInput !== correctCaptcha) {
                alert('验证码错误');
                return true; // 阻止表单提交
            }
            alert('验证码错误');
            return true; // 允许表单提交
        }

        window.onload = function() {
            const captchaImage = getRandomCaptcha();
            document.getElementById('captcha-image').src = captchaImage;
        };
